import React from 'react'
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import { StickyContainer, Sticky } from 'react-sticky';

export default function Sidebar() {
  const navigate = useNavigate();

  const handleclick = () => {
    localStorage.removeItem('token');
    navigate("/signup");
    alert("logged out successfully")
  }



  return (
    <div style={{

      height: '100%',

    }}>

      <nav style={{
        backgroundColor: '#5C5470',
        width: '20vw',
        minHeight: '100%',
        position: 'sticky',
        top: 0,
        justifycontent: 'flex-start',
      }}>
        <div>
          <div style={{
            //border: '2px solid white'
          }}>
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">


            </ul>

            {!localStorage.getItem('token') ?

              <div  role="search" style={{
                marginTop:'30vh',
                display: 'flex',
                left:'20px',
                position:'fixed'                 
              }}>
                <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                <li className="nav-item">         
                <Link  className="bi bi-postcard-heart-fill fs-1 text-decoration-none" aria-current="page" to="/posts" style={{

                  color: 'white',
                }}>   Posts </Link>
              </li>
              <li>
                <br></br>
                <br></br>
                <p class="fst-italic text-white">Create notes,<br></br> share ideas,
                 and spark inspirationâ€”join us!</p>

              </li>
                  <li>
                  <Link className="bi bi-box-arrow-in-right fs-4 text-decoration-none"  aria-current="page"  to="/login" style={{

                  color: 'white',
                }}> Login</Link>
                  </li>
                  <li>
                  <Link className="bi bi-check-circle-fill fs-4 text-decoration-none"  aria-current="page"  to="/signup" style={{

                  color: 'white',
                }}> Sign Up</Link>
                  </li>                        
                </ul>
                </div>
              :

              <div style={{
                marginTop:'30vh',
                display: 'flex',
                left:'20px',
                position:'fixed'                 
              }} >
                <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                <li className="nav-item" style={{
                  width:'700px',
                }}>         
                <Link  className="bi bi-postcard-heart-fill display-6 text-decoration-none" aria-current="page" to="/posts" style={{

                  color: 'white',

                }}>   <b>Posts</b> </Link>
              </li>

              <li className="nav-item">
                <Link className="bi bi-house-door-fill display-6 text-decoration-none" aria-current="page" to="/"  style={{

                  color: 'white',
                }}> <b>Home</b> </Link>
              </li>

              <li className="nav-item">
                <Link className="bi bi-person-circle display-6 text-decoration-none" aria-current="page" to="/"  style={{

                  color: 'white',
                }}> <b>Profile</b> </Link>
              </li>

              <li>
              <button className="bi bi-box-arrow-left display-6 text-decoration-none" onClick={handleclick} 
              style={{
                marginTop:'30vh',
                border:'0px',
                backgroundColor:'#5C5470',
              }}
              > <b>Logout</b></button>
                </li>

            </ul>

              </div>



            }

          </div>


        </div>
      </nav>

    </div>
  )
}
